collation.signatures:
Two signatures, original to the production of the manuscript, are still visible in the lower margin, right,  
                                       of ff.  70r, η΄ (8), and  110r, ιβ΄ (12); 
                                       the other signatures were lost to trimming.

origin.p:
The manuscript was copied 
                                in the first half of the 16th century, after 1538; 
                               since the texts contain some lessons from the Basel printed edition of Hippocrates by Janus Cornarius of 1538, 
                               this date should be taken as  terminus post quem for the copy (see  Rivier 1962, pp. 136-137; 
                                Ecca 2016, p. 63).
